import React from "react";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
// import Box from "@mui/material/Box";
import { useLocation } from "react-router-dom";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";

const VehicleStatus = () => {
  const { pathname } = useLocation();
  const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    textAlign: "h3",
    color: theme.palette.text.secondary,
    height: 60,
    lineHeight: "60px",
  }));
  const lightTheme = createTheme({ palette: { mode: "light" } });
  const statusArr ={
    elevation:"200m",
    temperature:"30c",
    locked:false,
    battery:"75.6%",
    throttle:true,
    controller:true,
    motor:true,
    overload:true,
    overcurrent:true,
}
const st1 ={
  display:"flex",
  flexdirection:"row",
  justifyContent:"space-between"
}

  return (
    <div>
      <div
        style={{
          margin: "20px",
        }}
      >
        Vehicle &gt; {pathname.slice(1, 6)}
      </div>
      <h3>vehicle status</h3>
      <Grid container spacing={2}>
        {[lightTheme].map((theme, index) => (
          <Grid item xs={6} key={index}>
            <ThemeProvider theme={theme}>
              <div style={
                  {
                    display:"flex",
                    flexDirection:"row",

                  }
                }>
                <div style={{
                  display:"flex",
                  flexDirection:"column",
                  justifyContent:"space-evenly",
                  padding:"20px",
                  width:"300px"
                }}>
                  <div style={st1}><b>Elevation:</b>{statusArr.elevation}</div>
                  <div style={st1}><b>Temperature:</b>{statusArr.temperature}</div>
                  <div style={st1}><b>Loacked:</b>{statusArr.locked ?(<i>&#10003;</i>):(<i>	&#10060;</i>) }</div>
                  <div style={st1}><b>Battery:</b>{statusArr.battery}</div>
                </div>
                <div style={{
                  display:"flex",
                  flexDirection:"column",
                  justifyContent:"space-evenly",
                  padding:"20px",
                  width:"200px"
                }}>
                  <div style={st1}><b>Throttle: </b>{statusArr.throttle ?(<i>&#10003;</i>):(<i>	&#10060;</i>)}</div>
                  <div style={st1}><b>Controller:</b>{statusArr.controller ?(<i>&#10003;</i>):(<i>	&#10060;</i>)}</div>
                  <div style={st1}><b>Motor:</b>{statusArr.motor ?(<i>&#10003;</i>):(<i>	&#10060;</i>)}</div>
                  <div style={st1}><b>Overload:</b>{statusArr.overload ?(<i>&#10003;</i>):(<i>	&#10060;</i>)}</div>
                  <div style={st1}><b>Overcurrent:</b>{statusArr.overcurrent ?(<i>&#10003;</i>):(<i>	&#10060;</i>)}</div>
                </div>
                </div>
            </ThemeProvider>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default VehicleStatus;
